// Need to refactor
const newPDFMode = false; // True if coloured bars, false if dots

function genClassReportWithID(classReportID){
    var pdf = new jspdf.jsPDF({ filters: ["ASCIIHexEncode"] }),
    margin = 15,
    verticalOffset = margin + 5.5
    
        //Get Date Generated
        today = new Date();
        date = today.getDate()+'/'+(today.getMonth()+1)+'/'+today.getFullYear();
        //Set properties on the document
        pdfTitle = "7Cs Class Report [Generated: " + date + "]";
        pdfName = "7Cs Report Year " + classData.year + " " +  classData.subject + " (" + classData.code + ")"

        pdf.setFont("helvetica", "normal");
    
        pdf.setProperties({
            title: pdfTitle,
            subject: '7Cs Report',		
            author: 'Sean McGinty',
            //keywords: '7Cs, Report',
            creator: 'Sean McGinty | seanmcginty.space'
        });
        //Page 1
        imgWesleyLogo = 'data:image/jpeg;base64,'
        imgPageOneMain = 'data:image/jpeg;base64,'
        pdf.addImage(imgPageOneMain, 'JPEG', 10, 8, 190, 232)
        pdf.addImage(imgWesleyLogo, 'JPEG', 190-392/9.5, 248, 392/9.5, 261/9.5)
    
        //Cover Page
        pdfClassHeader = "Year " + classData.year + " " + classData.subject + " (" + classData.code + ")";
    
        //Get Teacher
        teacher = "TEST TEACHER"
    
        pdfClassTeacher = "Teacher: " + teacher;
        pdfReportYear = "2021" + " REPORT";
        pdf.setFontSize(22);
        pdf.setTextColor(255,255,255);
        pdf.text(20, 232, pdfReportYear);
        pdf.setFontSize(15);
        pdf.setTextColor(0,0,0);
        pdf.setFont("helvetica", "bold");
        pdf.text(20, 260, pdfClassHeader);
        pdf.setFont("helvetica", "normal");
        pdf.text(20, 268, pdfClassTeacher);

        //Add a new page
        pdf.addPage();
    
        //Info Page
        pdf.addImage(imgWesleyLogo, 'JPEG', (205-392/12)/2, 8, 392/12, 261/12);
        pdf.setFontSize(13);
        pdf.setFont("helvetica", "bold");
        pdf.text(margin, 40, "Transcript");
        pdf.setFont("helvetica", "normal");
        pdf.setDrawColor(76,140,43);
        pdf.setLineWidth(1);
        pdf.line(15, 43, 195, 43);
        //Info Content
        verticalOffset = 50;
        text = "This report has been created to provide you with learning information regarding the class of Year 10 Indonesian. When reading this report, you will be made aware of their capabilities regarding the seven Wesley Capabilities. This information indicates how students are becoming stronger thinkers, positive connectors, purposeful doers and powerful self-activators and pursuing personal bests.";
        lines = pdf.setFont("helvetica", "normal")
            .setFontSize(11.5)
            .splitTextToSize(text, 180)
        pdf.text(margin, verticalOffset + 11.5 / 72, lines);
    
        //Psuedo Table of Results
        verticalOffset = 90;
        pdf.setFontSize(11.5);
        //Header
        pdf.setFont("helvetica", "bold");
        pdf.text(margin + 70.75, 82.5 - 11.5 / 72,"Rating (out of 17)");
        //Extra category for later
        pdf.text(margin + 123.5, 82.5 - 11.5 / 72,"AnotherCategoryTitle");
        //Body
        pdf.setFont("helvetica", "normal");
        textWesleyCs = ["Critical Thinking","Creativity","Commitment","Communication","Collaboration","Citizenship","Continuous Improvement"];
        //Set Base Var
        classAverages = ['n/a','n/a','n/a','n/a','n/a','n/a','n/a'];
        //Calculate Class Averages
        for (i=0; i<7; i++) {
            classAverageScore = 0;
            //Each Student
            for (j=0; j<classData.students.length; j++) {
                classAverageScore += classData.students[j].c[i]
            }
            classAverageScore /= classData.students.length
            classAverageScore = Math.round(classAverageScore * 100)/100;
            classAverages[i] = classAverageScore.toString();
        }
     
        //Display Class Average Data
        for (i=0;i<textWesleyCs.length;i++) {
            pdf.text(margin, verticalOffset + i * 7.5 + 11.5 / 72, textWesleyCs[i]);
            //Check if centering string is needed
            if (classAverages[i].length == 5) {
                pdf.text(margin + 85.5 - 3, verticalOffset + i * 7.5 + 11.5 / 72, classAverages[i]);
            } else if (classAverages[i].length == 4) {
                pdf.text(margin + 85.5 - 2.25, verticalOffset + i * 7.5 + 11.5 / 72, classAverages[i]);
            } else if (classAverages[i].length == 2) {
                pdf.text(margin + 85.5 - 0.35, verticalOffset + i * 7.5 + 11.5 / 72, classAverages[i]);            
            } else {
                pdf.text(margin + 85.5 + 0.75, verticalOffset + i * 7.5 + 11.5 / 72, classAverages[i]);      
            }
            //Extra category for later
            pdf.text(margin + 133.5, verticalOffset + i * 7.5 + 11.5 / 72, "CategoryFill");
            verticalOffset +=  (textWesleyCs.length + 0.5) * 11.5 / 72;
        }
        verticalOffset +=  47.5;
        pdf.line(15, verticalOffset, 195, verticalOffset);
    
        //Loop through students
        for (reportingStudent=0; reportingStudent<classData.students.length; reportingStudent++){
            //Check to see if page header is needed
            if (reportingStudent % 3 == 0) {
                //Footer
                pdf.setDrawColor(76,140,43);
                pdf.setLineWidth(1);
                pdf.line(15, 282.5, 195, 282.5);
                pdf.setFontSize(9);
                pdf.text(margin,287.5,pdfClassHeader)
                pdf.text(173.75,287.5,pdfReportYear)
                pdf.addPage();
                pdf.addImage(imgWesleyLogo, 'JPEG', (205-392/12)/2, 8, 392/12, 261/12);
                //Check if first page of students
                if (reportingStudent == 0) {
                    pdf.setFontSize(13);
                    pdf.setFont("helvetica", "bold");
                    pdf.text(margin-margin/5, 40, "Student Data");
                    pdf.setDrawColor(76,140,43);
                    pdf.setLineWidth(1);
                    pdf.line(margin-margin/5, 43, 195, 43);
                }
            }
            //Check if ymod needs to be changed if not first page
            if (reportingStudent < 3) {
                var ymod = (reportingStudent % 3) * 75;
            } else {
                var ymod = (reportingStudent % 3) * 75 - 12;
            }
            //Student Data First Person
            pdf.setFontSize(13);
            pdf.setFont("helvetica", "bold");
            pdf.text(margin, 52 + ymod, classData.students[reportingStudent].firstname + " " + classData.students[reportingStudent].surname);
            pdf.setDrawColor(76,140,43);
            pdf.setLineWidth(1);
            pdf.line(margin, 54 + ymod, 195, 54 + ymod);
            pdf.setFont("helvetica", "normal");
            pdf.setFontSize(11.5);
            //Student Data Import
            verticalOffset = 68;
            pdf.setDrawColor(0,0,0);
            pdf.setLineWidth(0.5);
            spacing = 5.5;
            pdf.line(margin, verticalOffset - spacing + ymod, 195, verticalOffset - spacing + ymod);
            //Header of Table
            for (i=-1;i<textWesleyCs.length;i++) {
                if (i == -1) {
                    verticalOffset -=  spacing * 11.5 / 72;
                    //pdf.text(margin + 3.5, verticalOffset + i * spacing + 11.5 / 72 - 0.5, "Class Average");
                    //Top Numbers
                    reportNumbersTable = ['1','3','5','7','9','11','13','15','17'];
                    // Add in n/a in top row
                    pdf.text(margin + 72.5 + -1 * 12.5, verticalOffset + i * spacing + 11.5 / 72 - 0.5 + ymod, 'n/a');
                    //Loop to display top numbers
                    for (j=0; j<9; j++){
                        pdf.text(margin + 72.5 + j * 12.5, verticalOffset + i * spacing + 11.5 / 72 - 0.5 + ymod, reportNumbersTable[j]);
                    }
                    //Line to end cell
                    pdf.line(margin, verticalOffset + (i - 1) * spacing + 0.5 + ymod, 195, verticalOffset + (i - 1) * spacing + 0.5 + ymod);
                    verticalOffset +=  spacing * 11.5 / 72;
                } else {
                    //Display full name
                    pdf.text(margin + 3.5, verticalOffset + i * spacing + 11.5 / 72 - 0.5 + ymod, textWesleyCs[i]);
                    //Display value for person
    
                    let wdx = margin + 73.75 + (classData.students[reportingStudent].c[i] - 1) * 12.5/2;
                    let wdy = verticalOffset + i * spacing + 11.5 / 72 - 2 + ymod;
                    let gradColors = ["#ff1700","#ff2e00","#ff4600","#ff5d00","#ff7400","#ff8b00","#ffa200","#ffb900","#ffd100","#ffe800","#e3f703","#c6ef07","#aae70a","#8edf0e","#71d811","#55d015","#39c818","#1cc01c"];
                    
                    if (newPDFMode) {
                        if (classData.students[reportingStudent].c[i] !== 0) {
                            pdf.setFillColor(gradColors[classData.students[reportingStudent].c[i]]);
                        } else {
                            pdf.setFillColor(0, 176, 38);
                        }

                        pdf.roundedRect((margin + 73.75), wdy-1.5, wdx-(margin + 73.75)+1.5, 3, 1.5, 1.5, 'F')
                    } else {
                        pdf.setFillColor(0, 0, 0)
                        if (classData.students[reportingStudent].c[i] < 10) {

                            pdf.circle(margin + 73.75 + (classData.students[reportingStudent].c[i] - 1) * 12.5/2, verticalOffset + i * spacing + 11.5 / 72 - 2 + ymod, 1.5, 'F')
                        } else {
                            pdf.circle(margin + 73.75 + (classData.students[reportingStudent].c[i] - 1) * 12.5/2 + 1, verticalOffset + i * spacing + 11.5 / 72 - 2 + ymod, 1.5, 'F')
                        }
                    }
    
                    verticalOffset +=  spacing * 11.5 / 72;
                    //Line to end cell
                    pdf.line(margin, verticalOffset + i * spacing + 0.5 + ymod, 195, verticalOffset + i * spacing + 0.5 + ymod);
                }
            }
            pdf.line(margin + 0.25, verticalOffset - i * (spacing * 11.5 / 72 + 0.5) - 2.3 - spacing + ymod, margin + 0.25, verticalOffset + (i - 1) * spacing + 0.3 + 11.5 / 72 + ymod);
            pdf.line(194.75, verticalOffset - i * (spacing * 11.5 / 72 + 0.5) - 2.3 - spacing + ymod, 194.75, verticalOffset + (i - 1) * spacing + 0.3 + 11.5 / 72 + ymod);
        }
        //Footer
        pdf.setDrawColor(76,140,43);
        pdf.setLineWidth(1);
        pdf.line(15, 282.5, 195, 282.5);
        pdf.setFontSize(9);
        pdf.text(margin,287.5,pdfClassHeader)
        pdf.text(173.75,287.5,pdfReportYear)
        
    pdf.save(pdfName);
}